import Header from "../comp/Header";
import Footer from "../comp/Footer";

// import { Helmet } from "react-helmet-async";
import {useEffect  } from 'react';
import { useNavigate } from "react-router-dom";
import { useAuthState } from 'react-firebase-hooks/auth';
import {auth} from '../firebase/config';
import Moment from 'react-moment';
const Protfile = () => {
  const [user, loading, error] = useAuthState(auth);
  const navigate = useNavigate();
  useEffect(() => {
  if(!user){
    navigate("/");
  }
  
  });

  if (loading) {
    return (
      <div>
        <p>Initialising User...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div>
        <p>Error: {error}</p>
      </div>
    );
  }

  if (user) {
  return (
    <>
      {/* <Helmet>
        <title>JAVASCRIPT Page</title>
        <meta name="description" content="JAVASCRIPTTTTTTTTTTTTTTTTTTTTT" />
        <style type="text/css">{`
   
 
        
    `}</style>
      </Helmet> */}
      <Header />
      <main>
      <h6>name:{user.displayName} </h6>
      <h6>email:{user.email}</h6>
      <h>DATE DE  CREATION DE COMPTE :<Moment date={user.metadata.lastSignInTime}/></h>
      <p>DATE DE  CREATION DE COMPTE :<Moment date={user.metadata.creationTime}/></p>
    </main>
      
      <Footer />
    </>
  );
}
}
export default Protfile;
